update obs set voided = true, void_reason = 'Visit has been voided but data is showing on dashboard', date_voided = now()
where encounter_id in (
    select
        encounter.encounter_id
    from encounter
             join encounter_type et on encounter.encounter_type = et.encounter_type_id
             join patient p on encounter.patient_id = p.patient_id
             join visit on encounter.visit_id = visit.visit_id
             join visit_type on visit.visit_type_id = visit_type.visit_type_id
             join patient_identifier on p.patient_id = patient_identifier.patient_id
    where encounter.voided = false and visit.voided = true and et.name like '%[Avni]%'
);



